import React from "react";
import logo from "../image/1611079.png"


export default function Header(){
    return(
        <div>
            <nav>
                <img src={logo} alt="my image"></img>
                <h3>ReactFacts</h3>
                <h4>React Courses-Project 1</h4>
            </nav>
        </div>
    )
};
